pragma solidity 0.8.19;


import "@uniswap/v2-periphery/contracts/libraries/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol"; 
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "hardhat/console.sol";


contract DAN is IERC20, Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    IERC20 public token;
    using SafeERC20 for IERC20;

    string private constant _name = 'DAN';
    string private constant _symbol = 'DAN';
    uint8 private constant _decimals = 18;
    uint256 private _totalSupply = 9869690000000 * (10 ** _decimals);

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) public isFeeExempt;

    uint256 private denominator = 10000;
    uint256 public marketingFee = 1000;
    uint256 public sellFee = 1000;
    uint256 public buyFee = 1000;
    address public marketing_receiver = 0xB5a915A0C9e505452E052a4d67Cdc1417e721dDe;
    //address private _uniswap = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D; 
    uint blocksUntilDeadline = 15; // for example

    IUniswapV2Router02 public router;
    address public pair;

    event RouterUpdated(address indexed newRouter);
    event MarketingReceiverUpdated(address indexed newMarketingReceiver);
    event FeesUpdated(uint256 marketingFee, uint256 sellFee, uint256 buyFee);
    event SwapFailed();
    event SwapSucceeded(uint256 amount, uint256 timestamp);



    constructor() Ownable() {
        IUniswapV2Router02 _router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);
        address _pair = IUniswapV2Factory(_router.factory()).createPair(address(this), _router.WETH());
        router = _router; pair = _pair;
        isFeeExempt[address(this)] = true;
        isFeeExempt[marketing_receiver] = true;
        isFeeExempt[msg.sender] = true;
        _balances[msg.sender] = _totalSupply;
        emit Transfer(address(0), msg.sender, _totalSupply);
    }


    function name() public pure returns (string memory) {
        return _name;
    }

    function symbol() public pure returns (string memory) {
        return _symbol;
    }

    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply; 
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public override nonReentrant returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }


    function transferWithFee(address recipient, uint256 amount, bool _fromTransferFrom) public nonReentrant returns (bool) {
        uint256 fee = 0;
        if (!isFeeExempt[msg.sender] && !isFeeExempt[recipient]) {
            if (isSell(msg.sender, recipient)) {
                fee = amount * sellFee / denominator;
            } else if (isBuy(msg.sender, recipient)) {
                fee = amount * buyFee / (denominator);
            }
        }

        uint256 amountAfterFee = amount.sub(fee);
        _transfer(msg.sender, recipient, amountAfterFee);

        if (fee > 0 && !_fromTransferFrom) {
            // Swap tokens for ETH
            address[] memory path = new address[](2);
            path[0] = address(this);
            path[1] = router.WETH();

            _approve(address(this), address(router), fee);

            try router.swapExactTokensForETH(
                    fee,
                    0,
                    path,
                    marketing_receiver,
                    block.number + blocksUntilDeadline
            )   {
                    emit SwapSucceeded(fee, block.timestamp);
                } catch {
                    emit SwapFailed();
                }
            }

        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override virtual returns (bool) {
        uint256 currentAllowance = _allowances[sender][msg.sender];
        require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
        unchecked {
            _approve(sender, msg.sender, currentAllowance - amount);
        }
        transferWithFee(recipient, amount, true); // Call transferWithFee instead
        return true;
    }

   

    function approve(address spender, uint256 amount) public virtual returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual returns (uint256) {
        return _allowances[owner][spender];
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender] + addedValue);
        return true;
    }


    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[msg.sender][spender];
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        _approve(msg.sender, spender, currentAllowance - subtractedValue);

        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        _balances[sender] = _balances[sender] - amount;
        _balances[recipient] = _balances[recipient] + amount;

        emit Transfer(sender, recipient, amount);
    }
    

    function isSell(address sender, address recipient) internal view returns (bool) {
        return sender != address(this) && sender != owner() && recipient == pair;
    }

    function isBuy(address sender, address recipient) internal view returns (bool) {
        return sender == pair && recipient != address(this);
    }


    function setMarketingReceiver(address newMarketingReceiver) external onlyOwner {
        require(newMarketingReceiver != address(0), "Marketing receiver cannot be zero address");
        marketing_receiver = newMarketingReceiver;
        isFeeExempt[newMarketingReceiver] = true;
        emit MarketingReceiverUpdated(newMarketingReceiver);
    }

    function setFees(uint256 newMarketingFee, uint256 newSellFee, uint256 newBuyFee) external onlyOwner() {
        require(newMarketingFee <= 5000 && newSellFee <= 5000 && newBuyFee <= 5000, "ERC20: fees too high");
        marketingFee = newMarketingFee;
        sellFee = newSellFee;
        buyFee = newBuyFee;

        emit FeesUpdated(newMarketingFee, newSellFee, newBuyFee);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from zero address");
        require(spender != address(0), "ERC20: approve to zero address");

        IERC20(owner).safeApprove(spender, amount);
        emit Approval(owner, spender, amount);
    }

       function setRouter(address newRouter) external onlyOwner() {
        require(newRouter != address(router), "Router already set to this address");
        router = IUniswapV2Router02(newRouter);
        pair = IUniswapV2Factory(router.factory()).createPair(address(this), router.WETH());
        emit RouterUpdated(newRouter);
   } 
}

